import { Button, TableCell, TableRow } from "@mui/material";
import { Edit, Delete } from "@mui/icons-material";
import { date } from "yup/lib/locale";

export default function TablesClientRow(props) {
    const buttonEditProps = {
        variant: "contained",
        onClick: () => props.handleEditClick(props.id),
    };

    const buttonDeleteProps = {
        variant: "contained",
        color: "error",
        onClick: () =>
            props.handleDeleteClick(props.id, props.nombre, props.apellido),
    };

    const setFormatoFecha = () => {
        const fecha = props.fechaNacimiento.split("T", 1);
        console.log("fecha", fecha);
        const fechaArray = fecha[0].split("/", 3);
        const fechaFormateada =
            fechaArray[2] + "/" + fechaArray[1] + "/" + fechaArray[0];
        console.log("fechaFormateada", fechaFormateada);
        return fechaFormateada;
    };

    return (
        <TableRow hover tabIndex={-1}>
            <TableCell align="left" key={"id"}>
                {" "}
                {props.id}
            </TableCell>
            <TableCell align="left" key={"nombre"}>
                {" "}
                {props.nombre}
            </TableCell>
            <TableCell align="left" key={"apellido"}>
                {" "}
                {props.apellido}
            </TableCell>
            <TableCell align="left" key={"numdoc"}>
                {" "}
                {props.numeroDocumento}
            </TableCell>
            <TableCell align="left" key={"tipoDoc"}>
                {" "}
                {props.tipoDocumento}
            </TableCell>
            {/* <TableCell align='left' key={"fechaNac"} > {props.fechaNacimiento.split("T", 1)}</TableCell> */}
            <TableCell align="left" key={"fechaNac"}>
                {" "}
                {setFormatoFecha()}
            </TableCell>
            <TableCell align="left" key={"editButton"}>
                {" "}
                <Button {...buttonEditProps}>
                    <Edit />
                </Button>
            </TableCell>
            <TableCell align="left" key={"deleteButton"}>
                {" "}
                <Button {...buttonDeleteProps}>
                    <Delete />
                </Button>
            </TableCell>
        </TableRow>
    );
}
